/**
 * The default euclidean distance that identifies whether two points are coincident
 * @constant
 * @type {Number}
 */
export declare const TOLERANCE = 0.000001;
/**
 * The minimum value to determine whether two floating point numbers are the same
 * @constant
 * @type {Number}
 */
export declare const EPSILON = 1e-10;
/**
 * Converts angle value av to radian value rv = av * AGL2RAD
 * @constant
 * @type {Number}
 */
export declare const AGL2RAD: number;
/**
 * Converts radian value rv to angle value av = rv * RAD2AGL
 * @constant
 * @type {Number}
 */
export declare const RAD2AGL: number;
/**
 * Half of the number PI
 * @constant
 * @type {Number}
 */
export declare const HALFPI: number;
/**
 * Two times the number PI
 * @constant
 * @type {Number}
 */
export declare const TWOPI: number;
